import React from 'react';
import { Box, Grid, makeStyles } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: { backgroundColor: theme.palette.grey[900] }
}))

const Footer = () => {
    const classes = useStyles();
    return (
        <>
            <footer>
                <Box>
                    <Grid container>
                        <Grid item lg={6} md={6} sm={6} xs={12}>111</Grid>
                        <Grid item lg={6} md={6} sm={6} xs={12}>000</Grid>
                    </Grid>
                </Box>
            </footer>
        </>
    )
}

export default Footer
